import unittest;

from leetcode.LongestPalindrome.solution import Solution


# from https://leetcode-cn.com/problems/add-two-numbers/description/

class SolutionTest(unittest.TestCase):

    def test_1(self):
        input = "babad"

        so = Solution()
        result = so.longestPalindrome(input)
        self.assertEqual("bab", result)

    def test_2(self):
        input = "abcba"
        so = Solution()
        result = so.longestPalindrome(input)
        self.assertEqual("abcba", result)

    def test_3(self):
        input = "abcda"
        so = Solution()
        result = so.longestPalindrome(input)
        self.assertEqual("a", result)

    def test_6(self):
        input = "cbbd"
        so = Solution()
        result = so.longestPalindrome(input)
        self.assertEquals("bb", result)


    def test_7(self):
        input = ""
        so = Solution()
        result = so.longestPalindrome(input)
        print(result)
        # self.assertEquals("yvvy",result)

    def test_8(self):
        input = ""
        so = Solution()
        result = so.longestPalindrome(input)
        print(result)
        # self.assertEquals(False, result)

    def test_9(self):
        input = "abcdasdfghjkldcba"
        so = Solution()
        result = so.longestPalindrome(input)
        # print(result)
        self.assertEquals("a", result)

    def test_10(self):
        # input  = ""
        input = "babadada"
        so = Solution()
        result = so.longestPalindrome(input)
        self.assertEquals("adada", result)
