    def test_11(self):
        input = ""
        so = Solution()
        result = so.longestPalindrome(input)
        print(result)
        input2 = ""
        result = so.longestPalindrome(input2)
        print(result)
        input3 = ""
        so = Solution()
        result = so.longestPalindrome(input3)
        print(result)


    def test_is_pan(self):
        so = Solution()
        result = so.isPalindrome("abc")
        self.assertEquals(False, result)
        result = so.isPalindrome("aba")
        self.assertEquals(True, result)
        result = so.isPalindrome("aaaa")
        self.assertEquals(True, result)
        result = so.isPalindrome("cabbab")
        self.assertEquals(False, result)

    def test_base(self):
        so = Solution()
        so.longestPalindrome("aba")
